import React from "react";
import Welcome from "./WelcomePage/Welcome";
import { BrowserRouter as Router, Route} from "react-router-dom";

function App() {
  return (
    <Router>
      <div>
          <Route exact path="/">
            <Welcome />
          </Route>
      </div>
    </Router>
  );
}

export default App;
